const Chatss = () => {
  return (
    <div className='Chats'>
     <div className="userchat">
        <img
          src="https://a.pinatafarm.com/500x500/c501ff63ac/advice-dog.jpg"
        
        />
        <div className="userchatinfo">
          <span>Bigge</span>
        </div>
      </div>
      
    </div>
  )
}

export default Chatss;
